import Caminhao from './foto.jpg';

export default class imagem extends Component {

    render() {
        return (
            <div source= {Caminhao} style={styles.backgroundImage}>
                <div style={styles.fotoDePerfil}
                    source={Caminhao} />
            </div>

        )
    }
}
